            <section className='home-explore' data-scroll-section>
                <div className="container-fluid">
                    <div className="content-box" ref={contentRef}>
                        <div className="heading-box">
                            <h2>Discover MLEIHA National Park</h2>
                        </div>

                        <div className="explore-item h-100" ref={(el) => (exploreItemsRef.current[0] = el)}>
                            <div className="row g-md-5">
                                <div className="col-lg-6">
                                    <div className="left">
                                        <div className="block">
                                            <p>
                                                Walking through Mleiha is like stepping back in time. Each site tells a story, waiting for you to unravel. Our guided tours provide in-depth insights into the significance of these discoveries, allowing you to connect with history in a personal and meaningful way. Mleiha is not just a destination; it’s a journey into the past, perfect for history enthusiasts and curious travellers alike.
                                            </p>
                                            <svg width="6" height="205" viewBox="0 0 6 205" fill="none" xmlns="http://www.w3.org/2000/svg">
                                                <path opacity="0.4" d="M3 0.113249L0.113249 3L3 5.88675L5.88675 3L3 0.113249ZM3 204.887L5.88675 202L3 199.113L0.113249 202L3 204.887ZM2.5 3V202H3.5V3H2.5Z" fill="#9C5849" />
                                            </svg>
                                        </div>
                                        <div className="block">
                                            <img loading="lazy" className='img-fluid' src="/images/home/explore-icon1.png" alt="" />
                                            <p>
                                                Explore the rich history of Mleiha, where ancient people once lived. Walk through old sites and see remains from thousands of years ago. From ancient forts and tombs to pottery and artifacts, Mleiha shows us how people lived in the past. Mleiha is one of the first places man landed when spreading out from Africa into Arabia, South Asia, and beyond.
                                            </p>
                                        </div>
                                    </div>
                                </div>
                                <div className="col-lg-6">
                                    <div className="right">
                                        <img loading="lazy" className='img-fluid' src="/images/home/explore2.png" alt="" />
                                    </div>
                                </div>
                            </div>
                        </div>

                        <div className="explore-item h-100" ref={(el) => (exploreItemsRef.current[1] = el)}>
                            <div className="row g-md-5">

                                <div className="col-lg-6">
                                    <div className="left">
                                        <div className="block">
                                            <svg width="6" height="205" viewBox="0 0 6 205" fill="none" xmlns="http://www.w3.org/2000/svg">
                                                <path opacity="0.4" d="M3 0.113249L0.113249 3L3 5.88675L5.88675 3L3 0.113249ZM3 204.887L5.88675 202L3 199.113L0.113249 202L3 204.887ZM2.5 3V202H3.5V3H2.5Z" fill="#9C5849" />
                                            </svg>
                                            <p>
                                                For thrill-seekers, Mleiha is a paradise of adventure. The vast desert landscape is ideal for exciting activities such as dune buggy rides and off-road explorations. Feel the adrenaline rush as you navigate the challenging terrain, experiencing the desert in a way few others have.
                                            </p>

                                        </div>
                                        <div className="block">
                                            <img loading="lazy" className='img-fluid' src="/images/home/explore-icon2.png" alt="" />
                                            <p>
                                                Beyond the thrill of the ride, Mleiha’s natural beauty is awe-inspiring. The dramatic landscapes, with their rolling dunes and rugged mountains, offer a picturesque backdrop for your adventures. Whether you’re an experienced off-roader or a first-time visitor, our adventure tours are designed to provide a safe, exhilarating experience that will leave you wanting more.
                                            </p>
                                        </div>
                                    </div>
                                </div>

                                <div className="col-lg-6">
                                    <div className="right">
                                        <img loading="lazy" className='img-fluid' src="/images/home/explore1.png" alt="" />
                                    </div>
                                </div>

                            </div>
                        </div>

                        <div className="explore-item h-100" ref={(el) => (exploreItemsRef.current[2] = el)}>
                            <div className="row g-md-5">
                                <div className="col-lg-6">
                                    <div className="left">
                                        <div className="block">
                                            <div className="block">
                                                <p>
                                                    Escape the busy city life and find peace in the serene desert of Mleiha. As the sun sets, the desert transforms into a peaceful haven where you can unwind and reconnect with nature. The vast, open skies offer a perfect setting to look at the stars, away from the light pollution of the city.
                                                </p>
                                                <svg width="6" height="205" viewBox="0 0 6 205" fill="none" xmlns="http://www.w3.org/2000/svg">
                                                    <path opacity="0.4" d="M3 0.113249L0.113249 3L3 5.88675L5.88675 3L3 0.113249ZM3 204.887L5.88675 202L3 199.113L0.113249 202L3 204.887ZM2.5 3V202H3.5V3H2.5Z" fill="#9C5849" />
                                                </svg>
                                            </div>
                                        </div>
                                        <div className="block">
                                            <img loading="lazy" className='img-fluid' src="/images/home/explore-icon3.png" alt="" />
                                            <p>
                                                Our private desert dining experiences allow you to enjoy  the calm and beauty of Mleiha at night. Enjoy a delicious meal under the stars, surrounded by the silent desert. The clear skies and the vast expanse creates a magical ambiance, making your evening in Mleiha truly unforgettable. Whether you’re with loved ones or on a solo retreat, the peace and beauty of the desert night will capture you.
                                            </p>
                                        </div>
                                    </div>
                                </div>
                                <div className="col-lg-6">
                                    <div className="right">
                                        <img loading="lazy" className='img-fluid' src="/images/home/explore3.png" alt="" />
                                    </div>
                                </div>
                            </div>
                        </div>

                    </div>
                </div>
            </section>

